import React, {Component} from 'react';
import {Button, Container, Nav, Navbar, NavDropdown, Offcanvas} from "react-bootstrap";

class NavBar extends Component {

    constructor(props) {
        super(props);

        this.onClickAddNewFlight = this.onClickAddNewFlight.bind(this);
    }


    onClickAddNewFlight = (event) => {
        console.log("Add New Flight Button Clicked");
    }

    render() {
        return (
            <div>
                <Navbar variant="dark" expand="lg">
                    <Container>
                        <Navbar.Brand href="#home">Airport Management System</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link href="#home">Home</Nav.Link>
                                <NavDropdown title="Flights" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="/add-new-flight"
                                                      onClick={this.onClickAddNewFlight}>Add New
                                        Flight</NavDropdown.Item>
                                    <NavDropdown.Item href="/add-new-aircraft">Add New Aircraft</NavDropdown.Item>
                                    <NavDropdown.Item href="">Aircraft Maintenance Schedule</NavDropdown.Item>
                                </NavDropdown>
                                <NavDropdown title="Travel Agency" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="add-new-employee">Add New Employee</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2">Add New Company</NavDropdown.Item>
                                </NavDropdown>
                                <NavDropdown title="Clients" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1">Add New Clients</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                        <h5 style={{color: '#ffffff', marginTop: "5px", marginRight: '10px'}}>Login as :</h5>
                        <Button size="sm">Log out</Button>
                    </Container>
                </Navbar>

            </div>
        );
    }
}

export default NavBar;
